pub enum Path<'a> {
    Root,
    Seq {
            parent: &'a Path,
            index: usize,
        },
    Map {
            parent: &'a Path,
            key: &'a str,
        },
    Some {
            parent: &'a Path,
        },
    NewtypeStruct {
            parent: &'a Path,
        },
    NewtypeVariant {
            parent: &'a Path,
        },
    Alias {
            parent: &'a Path,
        },
    Unknown {
            parent: &'a Path,
        },
}
